\echo 'Loading base tables data from hybrid system (994 real notes)...'

-- Ensure public schema exists
CREATE SCHEMA IF NOT EXISTS public;

-- Truncate tables to ensure clean state
TRUNCATE TABLE IF EXISTS public.note_comments_text CASCADE;
TRUNCATE TABLE IF EXISTS public.note_comments CASCADE;
TRUNCATE TABLE IF EXISTS public.notes CASCADE;
TRUNCATE TABLE IF EXISTS public.users CASCADE;
TRUNCATE TABLE IF EXISTS public.countries CASCADE;

-- ============================================================================
-- COUNTRIES TABLE
-- ============================================================================
-- Note: Countries are minimal. In production, these would be determined from coordinates
-- For testing, we'll insert a basic set
ON CONFLICT (country_id) DO NOTHING;

-- ============================================================================
-- USERS TABLE (841 users)
-- ============================================================================
ON CONFLICT (user_id) DO NOTHING;

-- ============================================================================
-- NOTES TABLE (994 notes)
-- ============================================================================
ON CONFLICT (note_id) DO NOTHING;

-- ============================================================================
-- NOTE_COMMENTS TABLE (2211 comments)
-- ============================================================================
ON CONFLICT (note_id, sequence_action) DO NOTHING;

-- ============================================================================
-- NOTE_COMMENTS_TEXT TABLE (2211 comments)
-- ============================================================================
ON CONFLICT (note_id, sequence_action) DO NOTHING;

-- Summary
\echo 'Data loaded successfully!'
\echo ''
\echo 'Summary:'
SELECT
  'countries' as table_name,
  COUNT(*) as count
FROM public.countries
UNION ALL
SELECT 'users', COUNT(*) FROM public.users
UNION ALL
SELECT 'notes', COUNT(*) FROM public.notes
UNION ALL
SELECT 'note_comments', COUNT(*) FROM public.note_comments
UNION ALL
SELECT 'note_comments_text', COUNT(*) FROM public.note_comments_text
ORDER BY table_name;
