  (52, 5, 'Ja, vi b√∏r v√¶re konsistente: name=Kobber* official_name=Kopper* Men... Navnet "Kopperhaugene og Vindernh√∏gda" (skrivefeil i siste der) er navnet p√• et verneomr√•de: https://lovdata.no/forskrift/2016-12-16-1629'),
  (52, 6, 'I SSR er vannet f√∏rt opp med tre navneformer: Kopperhaugtjernet, Kobberhaugtjern, og Kopperhaugtjern. F√∏rstenevnte er ¬´godkjent og tilr√•dd¬ª, mens de to andre er ¬´godkjent og ikkje tilr√•dd¬ª. Alle tre er ¬´uhandsama¬ª. Jeg legger de to variantene med -pp- inn som alt_name.'),
