  (52, 8, 'Jeg er uenig i √• bruke SSR som "fasit". Men basert p√• det du refererer til virker det som Kartverket har endret skrivem√•ten fra Kopper- til Kobber-?'),
  (52, 9, ''),
  (52, 10, 'Navnet har ikke v√¶rt saksbehandlet etter lov om stadnamn, som tr√•dte i kraft i 1991. Alle tre skriv√•m√•tene har status som godkjent, noe som betyr at de var i offentlig bruk f√∏r loven tr√•dte i kraft. Koppehaugtjernet har status som tilr√•dd/anbefalt/prioritert, og skal derfor brukes av det offentlige. Derfor skriver Kartverket Kopperhaugtjernet p√• sine egne kart. Men, som du sier, vi trenger ikke bruke SSR som ¬´fasit¬ª, og Kobberhaugtjern st√•r fortsatt som hovedform i OSM.'),
